query RestaurantData($location: String, $top: Int) {
  search(location: $location, limit: $top) {
    __typename
    total
    business {
      __typename
      name
      photos
      url
      display_phone
      review_count
      rating
      price
      categories {
        __typename
        title
      }
      hours {
        __typename
        is_open_now
      }
    }
  }
}

